import React, { useState, useEffect } from "react";
import { useParams } from "react-router-dom";
import axios from "axios";

function ClientForm() {
  const { serviceId } = useParams(); // Get the serviceId from the URL
  const [service, setService] = useState(null);
  const [formData, setFormData] = useState({
    fullName: "",
    mobile: "",
    email: "",
    documents: [],
  });
  const [error, setError] = useState("");

  useEffect(() => {
    // Fetch service details from backend
    axios
      .get(`/api/services/${serviceId}`)
      .then((response) => {
        setService(response.data);
        // Initialize documents array based on the number of required documents
        setFormData((prev) => ({
          ...prev,
          documents: Array(response.data.documents.length).fill(null),
        }));
      })
      .catch((err) => {
        console.error("Error fetching service:", err);
        setError("Service not found or an error occurred.");
      });
  }, [serviceId]);

  useEffect(() => {
    const fetchService = async () => {
      try {
        const { data } = await axios.get(`http://localhost:5000/api/services/${id}`);
        setService(data); // Update the state with the fetched service
      } catch (error) {
        console.error("Error fetching service details:", error);
        setError(true); // Handle error state
      }
    };

    fetchService();
  }, [id]);


  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData((prevData) => ({ ...prevData, [name]: value }));
  };

  const handleFileChange = (index, file) => {
    const updatedDocuments = [...formData.documents];
    updatedDocuments[index] = file;
    setFormData((prevData) => ({ ...prevData, documents: updatedDocuments }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    const formPayload = new FormData();

    formPayload.append("fullName", formData.fullName);
    formPayload.append("mobile", formData.mobile);
    formPayload.append("email", formData.email);

    formData.documents.forEach((file, index) => {
      if (file) formPayload.append(`document${index + 1}`, file);
    });

    axios
      .post(`/api/clients/submit`, formPayload)
      .then(() => alert("Form submitted successfully"))
      .catch((error) => console.error("Error submitting form:", error));
  };

  if (error) {
    return <p>{error}</p>;
  }

  if (!service) {
    return <p>Loading service details...</p>;
  }

  return (
    <div className="p-8">
      <h1 className="text-3xl font-bold mb-4">{service.name}</h1>
      <form onSubmit={handleSubmit} className="mt-6 space-y-4">
        <div>
          <label htmlFor="fullName" className="block text-sm font-medium text-gray-700">
            Full Name
          </label>
          <input
            type="text"
            id="fullName"
            name="fullName"
            value={formData.fullName}
            onChange={handleInputChange}
            required
            className="mt-1 p-2 w-full border rounded-md"
          />
        </div>

        <div>
          <label htmlFor="mobile" className="block text-sm font-medium text-gray-700">
            Mobile Number
          </label>
          <input
            type="tel"
            id="mobile"
            name="mobile"
            value={formData.mobile}
            onChange={handleInputChange}
            required
            className="mt-1 p-2 w-full border rounded-md"
          />
        </div>

        <div>
          <label htmlFor="email" className="block text-sm font-medium text-gray-700">
            Email
          </label>
          <input
            type="email"
            id="email"
            name="email"
            value={formData.email}
            onChange={handleInputChange}
            required
            className="mt-1 p-2 w-full border rounded-md"
          />
        </div>

        {service.documents.map((doc, index) => (
          <div key={index}>
            <label className="block text-sm font-medium text-gray-700">{doc}</label>
            <input
              type="file"
              onChange={(e) => handleFileChange(index, e.target.files[0])}
              className="mt-1 p-2 w-full border rounded-md"
            />
          </div>
        ))}

        <button
          type="submit"
          className="bg-blue-500 text-white px-4 py-2 rounded-md hover:bg-blue-600"
        >
          Submit
        </button>
      </form>
    </div>
  );
}

export default ClientForm;
